Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694970/eleje3st2wyg9u60jbiy.jpg', album_id: '5', title: 'The Ginza Apple Store', description: 'Ginza is a beautiful place to walk around and explore. During the weekends the roads are closed to traffic and it becomes the perfect place to walk around with your camera. On this day the light and mood were perfect making for a great day for photography.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694970/eleje3st2wyg9u60jbiy.jpg', height: 894, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694971/xbzsulp4tqvxyfyq6wce.jpg', album_id: '5', title: 'Suzuki Yakitori', description: 'I pass Suzuki Yakitori on a daily basis. I am always impressed with the level of effort Mr Suzuki puts into making Yakitori. When you dedicate your life to something you become very good at it. You see this everything in Japanese society.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694971/xbzsulp4tqvxyfyq6wce.jpg', height: 851, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694971/qwavb6im0mg042i6dce5.jpg', album_id: '5', title: 'Geisha in Gion', description: 'I was in Kyoto exploring the historic Gion district. Gion in Kyoto is one of the last places in Japan that still has an active Geisha District. Geisha have worked in Gion for more than 300 years. There is something beautiful and mysterious about a geisha. They are a moving, living, breathing works of art. Graceful, elegant and playful all at the same time.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694971/qwavb6im0mg042i6dce5.jpg', height: 854, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694971/jpwatldq3x1sf0aos4ck.jpg', album_id: '5', title: 'The Shop', description: 'I am a believer in always bringing your camera everywhere. Having a camera with you will significantly improve your ability to capture great photographs. I was driving and passed this very neat shop in Jiyugaoka. I luckily had a Leica M6 sitting in the passenger seat next to me so stopped for a quick shot.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694971/jpwatldq3x1sf0aos4ck.jpg', height: 851, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694971/zzstuspcpo0wxn7thgfw.jpg', album_id: '5', title: '246 in Shibuya', description: 'I love all of the levels out behind Shibuya Station. A very cool maze of highway overpasses, foot bridges, many lines of traffic and elevated train lines (behind me in this photo). It is amazing to see how complicated and intricate all of this is yet works at the same time. Take a minute and take notice of the excessive use of traffic cones. Think of this like one of those ‘Where’s Waldo’ pictures.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694971/zzstuspcpo0wxn7thgfw.jpg', height: 854, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694970/uhaljjivlhrm60uyyhho.jpg', album_id: '5', title: 'KomyoIn', description: 'Kyoto is an amazing place. Some of the smaller temples and shrines you could walk right past and not realize it was even there. The name of this Zen temple, “Komyo”, consists of two kanji characters; ”ko” – light of the sun and “myo” – light of the moon or stars. When combined, these mean the light given off from the body of Buddha, or wisdom / mercy of Buddha.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694970/uhaljjivlhrm60uyyhho.jpg', height: 854, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694971/pd8uu3liknkoetyytbd5.jpg', album_id: '5', title: 'The Mini', description: 'I don\'t think I would ever drive a Mini or even comfortably fit in one but I love to photograph them. Especially the old ones that are all over Tokyo. There is just something about them that make them such a great subject to shoot.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694971/pd8uu3liknkoetyytbd5.jpg', height: 851, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694972/earfhckih1t7flkz6n4b.jpg', album_id: '5', title: 'We all need a break', description: 'There is something relaxing and refreshing about seeing a taxi driver taking a break from the hustle of the never sleepy Tokyo. This is a city never rests so it is nice when you can find a quiet area to explore.', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694972/earfhckih1t7flkz6n4b.jpg', height: 851, width: 1280)
Photo.create(photo_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/v1463694972/xsbmaoy8hsgm5zhudmaw.jpg', album_id: '5', title: 'The Guitar Man', description: 'I was exploring Yanaka with some friends. Yanaka is an extremely cool part of Tokyo. We wondered over to Uneo Park for some shooting when I saw this man with his guitar case and girlfriend trying to keep up in her kimono...', thumbnail_url: 'http://res.cloudinary.com/dbe6vwqbe/image/upload/c_limit,h_60,w_90/v1463694972/xsbmaoy8hsgm5zhudmaw.jpg', height: 851, width: 1280)
